import { Link } from "react-router-dom";
const Footer = () => {
  return (
    <section>
      <div class="flex flex-row m-5 p-5">
        <h1 class="text-red-600 text-3xl">Create your own Meetup</h1>
        <Link to="" class="w- h-5 bg-slate-600 border-violet-600 border-2 rounded-md m-2 p-2">
          Get Started
        </Link>
      </div>
      <div>
        <nav>
          <h1> Your Account</h1>
          <ul>
            <li>
              {" "}
              <Link to=""> Sign Up</Link>
            </li>
          </ul>
        </nav>
      </div>
    </section>
  );
};

export default Footer;
